import React from 'react'
import ob from './OrderPage.module.css'
import Header from '../MainPage/Info/Header/Header'

const OrderPage = () => {
  return (
    <div className={ob.content}>
      <div>Hi</div>
      <Header />
    </div>
  )
}

export default OrderPage;
